import React from "react";


function SearchInput(props) {
    return (
      <div class="input-group mb-3" style={{width:'80vw'}}>
        <input type="text" height={{height: '38px'}} class="form-control" placeholder="Recipient's username" aria-label="Recipient's username" aria-describedby="basic-addon2"/>
        <div class="input-group-append ml-3">
          <button class="btn btn-secondary" height={{height: '38px'}}  type="button">Button</button>
        </div>
      </div>
    );
  }

export default SearchInput
